const coinListDataUtils = {
    marketNames: (names) => {
        const data = {};

        console.log(names);
        /*names.forEach(name => {
            if (name.market.split("-")[0] !== "KRW")
                data[name.market] = {
                    korean: name.korean_name
                };
        });*/
        return data;
    },
};

export {
    coinListDataUtils
}
